function lightboxVideoClose(item){
var iframes=item.querySelectorAll('.ba-item-custom-html iframe, .ba-item-video iframe');
for (var i=0; i < iframes.length; i++){
var src=iframes[i].src,
videoId=iframes[i].id;
if (src&&src.indexOf('youtube.com') !==-1&&'pauseVideo' in lightboxVideo[videoId]){
lightboxVideo[videoId].pauseVideo();
} else if (src&&src.indexOf('vimeo.com') !==-1&&'pause' in lightboxVideo[videoId]){
lightboxVideo[videoId].pause();
}
}
iframes=item.querySelectorAll('.ba-item-video video, .ba-item-custom-html video');
for (var i=0; i < iframes.length; i++){
var videoId=iframes[i].id;
lightboxVideo[videoId].pause();
}
}
function lightboxVideoOpen(item){
var iframes=item.querySelectorAll('.ba-item-custom-html iframe, .ba-item-video iframe'),
youtube=false,
vimeo=false,
id=+new Date();
for (var i=0; i < iframes.length; i++){
var src=iframes[i].src,
videoId;
if (src&&src.indexOf('youtube.com') !==-1){
if (!app.youtube){
youtube=true;
} else {
if (src.indexOf('enablejsapi=1')===-1){
if (src.indexOf('?')===-1){
src +='?';
} else {
src +='&'
}
src +='enablejsapi=1';
iframes[i].src=src;
}
if (!iframes[i].id){
iframes[i].id=id++;
}
videoId=iframes[i].id;
if (!lightboxVideo[videoId] || !('playVideo' in lightboxVideo[videoId])){
lightboxVideo[videoId]=new YT.Player(videoId, {
events: {
onReady: function(event){
lightboxVideo[videoId].playVideo();
}
}
});
} else {
lightboxVideo[videoId].playVideo();
}
}
} else if (src&&src.indexOf('vimeo.com') !==-1){
if (!app.vimeo){
vimeo=true;
} else {
if (!iframes[i].id){
iframes[i].id=id++;
}
videoId=iframes[i].id;
if (!lightboxVideo[videoId] || !('play' in lightboxVideo[videoId])){
src=src.split('/');
src=src.slice(-1);
src=src[0].split('?');
src=src[0];
var options={
id: src * 1,
loop: true,
};
lightboxVideo[videoId]=new Vimeo.Player(videoId, options);
}
lightboxVideo[videoId].play();
}
}
}
iframes=item.querySelectorAll('.ba-item-video video, .ba-item-custom-html video');
for (var i=0; i < iframes.length; i++){
if (!iframes[i].id){
iframes[i].id=id++;
}
videoId=iframes[i].id;
if (!lightboxVideo[videoId]){
lightboxVideo[videoId]=iframes[i];
}
lightboxVideo[videoId].play();
}
if (youtube || vimeo){
var object={
data : {}
};
if (youtube&&!vimeo){
object.data.type='youtube';
} else if (vimeo&&!youtube){
object.data.type='vimeo';
} else {
object.data.type='youtube+vimeo';
}
app.checkModule('loadVideoApi', object);
}
if (youtube){
lightboxVideo.overlay=item;
} else if (vimeo){
lightboxVideo.overlay=item;
}
return !youtube&&!vimeo;
}
function initLightbox($this, obj){
var obj=app.items[$this.dataset.id];
if (obj.type=='cookies'){
if (localStorage['ba-item-cookie']){
return false;
}
$g($this).find('.ba-item-button[data-cookie="accept"]').on('click', function(event){
event.preventDefault();
localStorage.setItem('ba-item-cookie', 'accept');
$g(this).closest('.ba-lightbox-backdrop').removeClass('visible-lightbox');
$g('body').removeClass('lightbox-open');
});
showLightbox($this);
} else if (obj.trigger.type=='time-delay'){
setTimeout(function(){
showLightbox($this);
}, obj.trigger.time);
} else if (obj.trigger.type=='scrolling'){
lightboxScroll($this, obj.trigger.scroll * 1);
} else if (obj.trigger.type=='exit-intent'){
$g(document).one('mouseleave.ba-lightbox'+$this.dataset.id, function(){
showLightbox($this);
});
} else {
lightboxScroll($this, 100);
}
}
function lightboxScroll($this, scroll){
var top,
docHeight,
htmlHeight;
$g(window).on('scroll.ba-lightbox'+$this.dataset.id+' load.ba-lightbox'+$this.dataset.id, function(){
top=$g(window).scrollTop();
docHeight=document.documentElement.clientHeight
htmlHeight=Math.max(
document.body.scrollHeight, document.documentElement.scrollHeight,
document.body.offsetHeight, document.documentElement.offsetHeight,
document.body.clientHeight, document.documentElement.clientHeight
);
var x=(docHeight + top) * 100 / htmlHeight;
if (x >=scroll || (scroll > 97&&x >=97)){
$g(window).off('scroll.ba-lightbox'+$this.dataset.id+' load.ba-lightbox'+$this.dataset.id);
showLightbox($this);
}
});
}
function showLightbox($this){
var obj=app.getObject($this.dataset.id);
if (!lightboxVideoOpen($this) || obj.disable==1){
return false;
}
$this.classList.add('visible-lightbox');
if (obj.position=='lightbox-center'){
document.body.classList.add('lightbox-open');
}
}
function compileOnePageValue(item){
var value=item.offset().top,
header=$g('header.header'),
comp=header[0] ? getComputedStyle(header[0]) : {},
top=window.pageYOffset,
stickies=$g('.ba-sticky-header'),
sticky=0;
if (item.closest('.ba-wrapper').parent().hasClass('header')){
value=0;
} else {
stickies.each(function(){
if (this.offsetHeight > 0){
let section=this.querySelector('.ba-sticky-header > .ba-section'),
obj=app.items[section.id],
offset=obj.desktop.offset;
if (app.view !='desktop'){
for (var ind in breakpoints){
if (!obj[ind]){
obj[ind]={};
}
offset=obj[ind].offset ? obj[ind].offset : offset;
if (ind==app.view){
break;
}
}
}
if ((!obj.scrollup&&offset < value) || (obj.scrollup&&offset < value&&value < top)){
sticky=this.offsetHeight > sticky ? this.offsetHeight : sticky;
}
}
});
if ((!header.hasClass('sidebar-menu') || (app.view !='desktop'&&app.view !='laptop'))&&comp.position=='fixed'){
sticky=header[0].offsetHeight > sticky ? header[0].offsetHeight : sticky;
if (header.find('.resizing-header').length > 0){
var resizingSection=getComputedStyle(header.find('.resizing-header')[0]);
value +=resizingSection.paddingTop.replace('px', '') * 1;
value +=resizingSection.paddingBottom.replace('px', '') * 1;
}
}
value -=sticky;
}
return value;
}
function checkOnePage(){
var alias=location.hash.replace('#', '');
alias=decodeURIComponent(alias);
if (alias&&document.querySelector('.ba-item-one-page-menu a[data-alias="'+alias+'"]')){
$g('.ba-item-one-page-menu a[data-alias="'+alias+'"]').each(function(){
var item=$g(this.hash);
if ($g(this.parentNode).height() > 0&&this.hash&&item.length > 0){
$g(this).closest('ul').find('.active').removeClass('active');
$g('.ba-item-one-page-menu ul.nav.menu a[href*="'+this.hash+'"]').parent().addClass('active');
var value=compileOnePageValue(item);
if (window.pageYOffset !=value){
$g('html, body').stop().animate({
'scrollTop' : value
}, 1000);
}
return false;
}
});
} else {
checkOnePageActive();
}
}
function checkOnePageActive(){
var items=new Array(),
alias='',
flag=false;
$g('.ba-item-one-page-menu ul li a').each(function(){
if ($g(this).height() > 0&&this.hash&&$g(this.hash).height() > 0){
var computed=getComputedStyle(document.querySelector(this.hash));
if (computed.display !='none'){
items.push(this);
}
}
});
items.sort(function(item1, item2){
var target1=$g(item1.hash),
target2=$g(item2.hash),
top1=target1.closest('header.header').length==0 ? target1.offset().top : 0,
top2=target2.closest('header.header').length==0 ? target2.offset().top : 0;
if (top1 > top2){
return 1;
} else if (top1 < top2){
return -1;
} else {
return 0;
}
});
for (var i=items.length - 1; i >=0; i--){
alias=items[i].dataset.alias;
var value=compileOnePageValue($g(items[i].hash)),
url=location.href.replace(window.location.hash, '')+'#'+alias;
if (Math.floor(value) <=Math.floor(window.pageYOffset) + 1){
flag=true;
$g('.ba-item-one-page-menu ul.nav.menu a[href*="'+items[i].hash+'"]').closest('ul').find('.active').removeClass('active');
$g('.ba-item-one-page-menu ul.nav.menu a[href*="'+items[i].hash+'"]').parent().addClass('active');
break;
}
}
if (!flag){
$g('.ba-item-one-page-menu .main-menu ul.nav.menu .active').removeClass('active');
if (window.location.hash){
//window.history.replaceState(null, null, location.href.replace(window.location.hash, ''));
/*
let target=$g(window.location.hash+', [name="'+window.location.hash.replace('#', '')+'"]');
if (target.length){
let position=target.offset().top;
$g('html, body').stop().animate({
scrollTop: position
}, 1000);
}*/
}
} else {
if (decodeURI(window.location.hash) !='#'+alias){
window.history.replaceState(null, null, url);
}
}
}
